import React from 'react';

const About: React.FC = () => {
    return (
        <div className="content-box">
            <h2>About Me</h2>
            <p>Hello! I'm Elijah Hughes, a passionate developer with a love for creating innovative solutions. Welcome to my personal site where you can learn more about my work and projects.</p>
        </div>
    );
};

export default About;

// Add this line to make the file a module
export {};
